import React from "react";
import styled from "styled-components";
import Spacer from "../../../components/Spacer";
import Card from "../../../components/Card";
import CardButton from "../../../components/CardButton";
const Specie: React.FC = ({ text }) => {
  return (
    <>
      <Spacer size="sm" />
      <Spacer size="sm" />
      <Card>
        <Spacer />
        <div className="flex-jc-center color-grey">
          <div>抵押资产数量</div>
          <div>
            余额：<span className="color-dark">23.3333</span>
          </div>
        </div>
        <Spacer />
        <CardButton className="">
          <Spacer size="sm" />

          <div className="flex-jc-center">
            <div className="flex-jc-center">
              <img
                src={require("../../../assets/img/ETH_icon.png")}
                width="35"
                height="35"
                className="margin-right-10"
              />
              ETH
            </div>
            <div>0.000001</div>
          </div>

          <Spacer size="sm" />
        </CardButton>
        <Spacer />
      </Card>
      <Spacer size="sm" />
      <Spacer size="sm" />
    </>
  );
};

export default Specie;
